import React from "react";
import { Box, Grid, ThemeProvider } from "@material-ui/core";
import theme from "./theme/theme";
import Header from "./component/Header/";

export default () => {
  return <ThemeProvider theme={theme}>

    <Header/>
    <Grid container>
      <Grid item xs={10}>

      </Grid>
    </Grid>
  </ThemeProvider>
};
